"""
Orbifold equivalences from

> Andreas Recknagel, Paul Weinreb
> "Orbifold equivalence: structure and new examples."
> arXiv preprint arXiv:1708.08359 (2017).

The authors graciously made these orbifold equivalences available
in a machine-readable way at
    https://nms.kcl.ac.uk/andreas.recknagel/oeq-page/defectslistforweb.txt
"""

import PolynomialRings: Ideal, base_extend, @numberfield!

import ..OrbifoldEquivalence: materialize_ansatz

function _orbifold_equivalence_def(f::Type{TwoVariables.A₂A₂}, g::Type{TwoVariables.A₅}, left_vars, right_vars)
    F = @numberfield! ℚ[a1, a2, j] / (
        j^2 + 1,
        4a2^3 - 1,
        a1^2 -3a2^2,
    )
    x, y = left_vars
    u, v = right_vars
    R = promote_type(F, typeof(x), typeof(y), typeof(u), typeof(v))

    Q = zeros(R, 4, 4)
    Q[1,3] = u^2 - a2*(x + y)
    Q[1,4] = a1*(u*x - u*y) + j*v
    Q[2,3] = a1*(u*y - u*x) + j*v
    Q[2,4] = -64a2^8*y^2 + 16a2^5*x*y - u^4 - a2*(u^2*x + u^2*y) - 4a2^2*x^2
    Q[3,1] = -Q[2,4]
    Q[3,2] = Q[1,4]
    Q[4,1] = Q[2,3]
    Q[4,2] = -u^2 + a2*(x + y)

    return Q
end

function _orbifold_equivalence_def(f::Type{TwoVariables.D₇}, g::Type{TwoVariables.E₆}, left_vars, right_vars)
    F = @numberfield! ℚ[β] / (β^8 - 162β^4 - 2187)
    a1, a2 = 3(β/3)^6/2 - 5(β/3)^2/2, β/3
    x, y = left_vars
    u, v = right_vars
    R = promote_type(F, typeof(x), typeof(y), typeof(u), typeof(v))

    Q = zeros(R, 6, 6)
    Q[4, 1]  =  (-a2^2 + 2*a1)*x^5 + (2*a2^2 + -4*a1)*x^3*u + x^2*v^2 + (-a2^2 + 2*a1)*x*u^2 + -u*v^2 + -a2^2*y^2
    Q[5, 1]  =  (-a2^2 + 2*a1)*x^3*v + (-a1*a2^3 + 2*a1^2*a2)*x^2*y + (a2^2 + -2*a1)*x*u*v + v^3 + a2*y*u
    Q[6, 1]  =  (a1*a2^6 + -5*a1^2*a2^4 + 8*a1^3*a2^2 + -4*a1^4 + -2*a2^4 + 8*a1*a2^2 + -8*a1^2)*x^4 + (a2^4 + -3*a1*a2^2 + 2*a1^2)*x^2*u + u^2 + -a2*y*v
    Q[4, 2]  =  (-a2^2 + 2*a1)*x^3*v + (-a2^5 + 3*a1*a2^3 + -2*a1^2*a2 + -a2)*x^2*y + (a2^2 + -2*a1)*x*u*v + v^3 + -a2*y*u
    Q[5, 2]  =  (-a1*a2^6 + 5*a1^2*a2^4 + -8*a1^3*a2^2 + 4*a1^4 + a2^4 + -5*a1*a2^2 + 6*a1^2)*x^4 + x^2*u + (-a2^2 + 2*a1)*x*v^2 + u^2
    Q[6, 2]  =  (-a2^4 + 3*a1*a2^2 + -2*a1^2 + -1)*x^2*v + (a2^3 + -2*a1*a2)*x*y + -u*v
    Q[4, 3]  =  (a1*a2^2 + -2*a1^2)*x^4 + (-a1*a2^2 + 2*a1^2 + -1)*x^2*u + u^2 + a2*y*v
    Q[5, 3]  =  (a1*a2^2 + -2*a1^2)*x^2*v + (-a2^3 + 2*a1*a2)*x*y + -u*v
    Q[6, 3]  =  (a2^2 + -2*a1)*x^3 + (-a2^2 + 2*a1)*x*u + v^2
    Q[1, 4]  =  (a2^2 + -2*a1)*x
    Q[2, 4]  =  v
    Q[3, 4]  =  (a2^4 + -3*a1*a2^2 + 2*a1^2 + 1)*x^2 + u
    Q[1, 5]  =  v
    Q[2, 5]  =  -x^2 + u
    Q[3, 5]  =  a2*y
    Q[1, 6]  =  (-a1*a2^2 + 2*a1^2)*x^2 + u
    Q[2, 6]  =  -a2*y
    Q[3, 6]  =  (-a2^2 + 2*a1)*x^3 + (a2^2 + -2*a1)*x*u + v^2


    return Q
end

function _orbifold_equivalence_def(f::Type{TwoVariables.D₁₀}, g::Type{TwoVariables.E₇}, left_vars, right_vars)
    F = @numberfield! ℚ[a3] / (64a3^54 - 401808a3^36 + 29496a3^18 - 1)
    a2 = (-13246400a3^50 +  83164210912a3^32  - 6105637304a3^14)//360639
    a1 = -64a3^52 + 401808a3^34 - 29496a3^16
    x, y = left_vars
    u, v = right_vars
    R = promote_type(F, typeof(x), typeof(y), typeof(u), typeof(v))

    Q = zeros(R, 4, 4)
    Q[3, 1]  =  (a1^6 + 4*a1^4*a2 + 4*a1^2*a2^2)*x^6 + (-2*a1^4 + -4*a1^2*a2)*x^4*v + (-a1^3 + -2*a1*a2)*x^3*u + a1^2*x^2*v^2 + a1*x*u*v + v^3 + u^2
    Q[4, 1]  =  (-3//2*a1^4 + -3*a1^2*a2 + -1//2*a2^2)*x^5 + -a2*x^3*v + x*v^2 + -a3*x*y
    Q[3, 2]  =  (3//2*a1^5 + 3*a1^3*a2 + 1//2*a1*a2^2)*x^4 + a1*a2*x^2*v + -a1*v^2 + -a1*a3*y
    Q[4, 2]  =  (a1^3 + 2*a1*a2)*x^3 + -a1*x*v + u
    Q[1, 3]  =  (a1^3 + 2*a1*a2)*x^3 + -a1*x*v + u
    Q[2, 3]  =  (3//2*a1^4 + 3*a1^2*a2 + 1//2*a2^2)*x^5 + a2*x^3*v + -x*v^2 + a3*x*y
    Q[1, 4]  =  (-3//2*a1^5 + -3*a1^3*a2 + -1//2*a1*a2^2)*x^4 + -a1*a2*x^2*v + a1*v^2 + a1*a3*y
    Q[2, 4]  =  (a1^6 + 4*a1^4*a2 + 4*a1^2*a2^2)*x^6 + (-2*a1^4 + -4*a1^2*a2)*x^4*v + (-a1^3 + -2*a1*a2)*x^3*u + a1^2*x^2*v^2 + a1*x*u*v + v^3 + u^2

    return Q
end

